        width : 200,
        marginBottom : 30,
    },
    addressCard : {
        padding : 20,
        borderRadius : 10,
        boxShadow: "0px 16px 24px rgba(0, 0, 0, 0.06), 0px 2px 6px rgba(0, 0, 0, 0.04), 0px 0px 1px rgba(0, 0, 0, 0.04)",
        minHeight : 200,
        marginBottom : 20
    },
    button : {
        width : "auto",
        paddingLeft : 20,
        paddingRight : 20
    }
})

